        0,
        0,
        0
    ]);
} catch (e) {
}
if (hasAF && isEnabled == 1) {
    var threshRot = lyrAF('ADBE Transform Group')('ADBE Rotate Z');
    threshRot %= 360;
    var ctrlAngle = $bm_neg(radiansToDegrees(Math.atan2($bm_sub(b[0], a[0]), $bm_sub(b[1], a[1]))));
    var offsetAngle = $bm_sub(threshRot, ctrlAngle);
